response.body:
*{
  box-sizing: border-box;
}

html{
  margin: 0;
  height: 100%;
  min-height: 100vh;
}

body{
  margin: 0;
  height: 100%;
}


.hidden{
  display: none;
}

.shown{
  display: block;
}

.container{
    border: 1px solid black;
    position: relative;
    display: flex;
    flex-direction: column;
    min-width: 300px;
    min-height: 100%;
    overflow: auto;

    background: #fff;

    color: rgb(47, 59, 70);
    font-family: Helvetica, Arial, sans-serif;
    font-size: 1em;
    font-weight: 300;

    font-synthesis: none;
    text-rendering: optimizeLegibility;
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
  }

.screen{
  height: 100%;
  width: 100%;
  padding: 7px 24px;

  position: relative;
  display: flex;
  flex-grow: 1;
  align-items: center;
  justify-content: center;
  flex-direction: column;

}
@media only screen and (max-width: 390px) {
  .screen{
    padding: 7px 16px;
  }
}
.embeddedSessionID{
  margin: 1px;
  display: flex;
  justify-content: center;
  font-size: 8pt;
  color: #000000cc;
}
*{
    box-sizing: border-box;
}

.spinning{
    display: inline-flex;
    -webkit-animation: spin 1s linear infinite;
    -moz-animation: spin 1s linear infinite;
    animation: spin 1s linear infinite;
}

.loading.icon circle {
  stroke-width: 6px;
  stroke-dasharray: 283px;
  stroke-dashoffset: 140px;
}

@-moz-keyframes spin {
  from {
    transform: rotate(0deg);
  }

  to {
    transform: rotate(360deg);
  }
}
@-webkit-keyframes spin {
  from {
    transform: rotate(0deg);
  }

  to {
    transform: rotate(360deg);
  }
}
@keyframes spin {
  from {
    transform: rotate(0deg);
  }

  to {
    transform: rotate(360deg);
  }
}
.success.icon circle {
    stroke-width: 6px;
}

.success.icon path {
    stroke-width: 5px;
    stroke-linecap: round;
    stroke-linejoin: round;
    stroke-dasharray: 100px;
    stroke-dashoffset: 0;
}
/* This file is replicating the relavant default styles from ec-game-core */

.error.text {
    font-size: 1em;
    font-family: Helvetica, arial, sans-serif;
    font-weight: 300;
    margin: 30px 0px;
    text-align: center;
    -webkit-font-smoothing: initial;
}

.error.button {
    padding: 12px 20px;
    background: rgb(47, 59, 70);
    letter-spacing: 0.4px;
    color: rgb(255, 255, 255);
    width: 100%;
    border: none;
    cursor: pointer;
    font-size: 1em;
    line-height: 18px;
    font-family: Helvetica, arial, sans-serif;
    font-weight: 600;
    text-align: center;
    margin: 0px;
    -webkit-font-smoothing: initial;
}
